    const dataValue = params.get('data');
    if (!dataValue) {
        params.set('data', 'https://raw.githubusercontent.com/tabkram/json-to-graph/main/data/trace.json');
        window.location.href = `${location.href.split('?')[0]}?${params.toString()}`;
    }

